INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Veritatis enim voluptatum cum ipsa.', 'Rem porro velit modi laboriosam quasi. Molestiae ea porro ut voluptas tenetur et. Et placeat non laborum.', 'Fugiat et et sed illo maxime. Harum id ea eos. Explicabo unde non a cumque saepe.', '1980-04-15');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Earum vitae ut possimus quaerat architecto deserunt.', 'Officiis est sit nam est aut hic maxime accusantium. Aliquam velit voluptates laborum dolore.', 'Harum numquam quo eos facere autem dolores quo. Tenetur quia enim modi aliquid distinctio. Fuga eos ratione in voluptas architecto. Cumque pariatur nam ipsam neque blanditiis omnis tempora.', '1987-04-04');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Quasi architecto non nihil voluptatem blanditiis modi alias veniam.', 'Et ut eos molestiae quibusdam corporis nisi nihil. Et necessitatibus incidunt a blanditiis vel dolor eum numquam. Consequatur sequi reiciendis delectus sed quia.', 'Et voluptatem similique sit dolorem et perspiciatis. Repellendus vel est non qui eos et ipsum modi. Expedita aut iusto atque perferendis consequuntur. Quisquam aspernatur reprehenderit incidunt qui.', '1990-06-23');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Sint dolores eum eos est aliquam quos nisi.', 'Asperiores quia omnis sed omnis qui voluptates quo. Laudantium quia ipsam ut sapiente perferendis. Quisquam nemo animi cum.', 'Dolores voluptatem voluptatem nobis doloremque blanditiis. Et inventore minima optio assumenda. Non cupiditate placeat et reprehenderit. Esse a deleniti ut iste et.', '1971-08-29');
